import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate, useLocation } from 'react-router-dom';
import AdminAddQuestion from './pages/AdminAddQuestion';
import AdminAddSolution from './pages/AdminAddSolution';
import AdminManageQuestions from './pages/AdminManageQuestions';
import AdminManageSolutions from './pages/AdminManageSolutions';
import Login from './pages/Login';
import ProtectedRoute from './components/ProtectedRoute';

const Navigation = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const isLoggedIn = localStorage.getItem('access_token');
  const username = localStorage.getItem('username');

  // ซ่อน Navigation เมื่ออยู่หน้า login หรือยังไม่ได้ login
  if (location.pathname === '/' || !isLoggedIn) {
    return null;
  }

  const handleLogout = () => {
    localStorage.removeItem('access_token');
    localStorage.removeItem('token_type');
    localStorage.removeItem('username');
    navigate('/login');
  };

  return (
    <nav className="bg-primary-600 text-white shadow-lg">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center py-4">
          <h1 className="text-2xl font-bold">Guru Web - ระบบโจทย์-เฉลย</h1>
          <div className="flex items-center space-x-4">
            {isLoggedIn ? (
              <>
                <Link to="/admin/add-question" className="hover:text-primary-200">เพิ่มโจทย์</Link>
                <Link to="/admin/add-solution" className="hover:text-primary-200">เพิ่มเฉลย</Link>
                <Link to="/admin/manage-questions" className="hover:text-primary-200">จัดการโจทย์</Link>
                <Link to="/admin/manage-solutions" className="hover:text-primary-200">จัดการเฉลย</Link>
                <span className="text-primary-200">สวัสดี, {username}</span>
                <button 
                  onClick={handleLogout}
                  className="bg-red-500 hover:bg-red-600 px-3 py-1 rounded text-sm"
                >
                  ออกจากระบบ
                </button>
              </>
            ) : (
              <Link to="/login" className="bg-indigo-500 hover:bg-indigo-600 px-3 py-1 rounded">เข้าสู่ระบบ</Link>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        {/* Navigation */}
        <Navigation />

        {/* Main Content */}
        <main className="container mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/admin/add-question" element={
              <ProtectedRoute>
                <AdminAddQuestion />
              </ProtectedRoute>
            } />
            <Route path="/admin/add-solution" element={
              <ProtectedRoute>
                <AdminAddSolution />
              </ProtectedRoute>
            } />
            <Route path="/admin/manage-questions" element={
              <ProtectedRoute>
                <AdminManageQuestions />
              </ProtectedRoute>
            } />
            <Route path="/admin/manage-solutions" element={
              <ProtectedRoute>
                <AdminManageSolutions />
              </ProtectedRoute>
            } />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
